import http from "./axios";

export const getData = () => {
  return http.request({
    url: "/home/getData",
    method: "get",
  });
};

export const getSupplier = () => {
  return http.request({
    url: "/supplier",
    method: "get",
  });
};

export const addSupplier = () => {
  return http.request({
    url: "/supplier",
    method: "post",
  });
};

export const editSupplier = () => {
  return http.request({
    url: "/supplier",
    method: "post",
  });
};
